import React, { useState } from "react";
import "./App.css";

function Folder({ open, handleImgDivClick, folderItems }) {
  return (
    <>
      <img
        src={`./images/${open}.png`}
        alt="folder"
        onClick={handleImgDivClick}
      />
      {folderItems.name}
    </>
  );
}

export default Folder;
